import React from 'react'
import { useParams } from 'react-router-dom';
const MovieDetail = ({ data }) => {
    const { id } = useParams()
    const movie = data.results.find((m) => m.id.toString() === id)
  return (
    <div>
      {id}
      dcsd 
      movie : {movie.id}
    </div>
  )
}

export default MovieDetail
